(lib.index = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});
	this.___GetDepth___ = function(obj) {
		var depth = obj.depth;
		var cameraObj = this.___camera___instance;
		if(cameraObj && cameraObj.depth && obj.isAttachedToCamera)
		{
			depth += depth + cameraObj.depth;
		}
		return depth;
		}
	this.___needSorting___ = function() {
		for (var i = 0; i < this.getNumChildren() - 1; i++)
		{
			var prevDepth = this.___GetDepth___(this.getChildAt(i));
			var nextDepth = this.___GetDepth___(this.getChildAt(i + 1));
			if (prevDepth < nextDepth)
				return true;
		}
		return false;
	}
	this.___sortFunction___ = function(obj1, obj2) {
		return (this.exportRoot.___GetDepth___(obj2) - this.exportRoot.___GetDepth___(obj1));
	}
	this.on('tick', function (event){
		var curTimeline = event.currentTarget;
		if (curTimeline.___needSorting___()){
			this.sortChildren(curTimeline.___sortFunction___);
		}
	});
	// timeline functions:
	this.frame_0 = function() {
		if(this.fail.parent == undefined || this.fail.parent == this)
		this.fail = this.fail.fail;
		if(this.win.parent == undefined || this.win.parent == this)
		this.win = this.win.win;
		if(this.endcard.parent == undefined || this.endcard.parent == this)
		this.endcard = this.endcard.endcard;
		if(this.intro.parent == undefined || this.intro.parent == this)
		this.intro = this.intro.intro;
		if(this.game.parent == undefined || this.game.parent == this)
		this.game = this.game.game;
	}
	this.frame_1 = function() {
		this.___loopingOver___ = true;
		stage.enableMouseOver();
		cjs.Touch.enable(stage);
		stage.enableMouseOver(10);
		var canvas = document.getElementById("canvas");
		var ctx = canvas.getContext('2d');
		this.stop();
		class Gears {
			gear;
			place;
			startX;
			startY;
			offsetX;
			offsetY;
			clickable = true;
			gearW;
			gearH;
			placeW;
			placeH;
			constructor(gear, place) {
				this.gear = gear;
				this.place = place;
				this.place.hitable = true;
				this.startX = gear.x;
				this.startY = gear.y;
				this.gear.addEventListener("mousedown", this.Grab.bind(this));
				this.gear.addEventListener("pressmove", this.Move.bind(this));
				this.gear.addEventListener("pressup", this.Release.bind(this));
			}
			Grab(evt) {
				if (this.clickable) {
					this.offsetX = this.gear.x - evt.stageX
					this.offsetY = this.gear.y - evt.stageY
					update = true;
				}
			}
			Move(evt) {
				this.gear.x = this.offsetX + evt.stageX;
				this.gear.y = this.offsetY + evt.stageY;
				update = true;
			}
			Release(evt) {
				this.gearW = this.gear.nominalBounds.width * .33;
				this.gearH = this.gear.nominalBounds.height * .33;
				this.placeW = this.place.nominalBounds.width * .33;
				this.placeH = this.place.nominalBounds.height * .33;
				update = true;
				if (this.gear.x >= this.place.x + this.placeW || this.gear.x + this.gearW <= this.place.x || this.gear.y >= this.place.y + this.placeH || this.gear.y + this.gearH <= this.place.y) {
					createjs.Tween.get(this.gear)
						.to({
							x: this.startX,
							y: this.startY,
							rotation: +360
						}, 1150, createjs.Ease.backOut);
				} else {
					createjs.Tween.get(this.gear)
						.to({
							x: this.place.x,
							y: this.place.y,
						}, 575, createjs.Ease.cubicInOut)
						.call(this.FadeOut.bind(this));
				}
			}
			FadeOut() {
				window.dispatchEvent(new Event('placeSFX'));
				if (this.place.hitable) {
					this.place.hitable = false;
					this.gear.gotoAndPlay(1);
					createjs.Tween.get(this.place)
						.wait(400)
						.call(this.StartPlace.bind(this));
				}
			}
			StartPlace() {
				counter++;
				this.place.gotoAndStop(1);
				this.gear.visible = false;
				this.clickable = false;
				window.dispatchEvent(new Event('gameEnd'));
			}
		}
		var update = false;
		var intro = this.intro;
		var game = this.game;
		var endcard = this.endcard;
		var win = this.win;
		var fail = this.fail;
		var gear1 = game.gear1red;
		var gear5 = game.gear5red;
		var gear4 = game.gear4red;
		var place1 = game.place1;
		var place4 = game.place4;
		var place5 = game.place5;
		var timer = game.timer;
		var counter = 0;
		var Pair1 = new Gears(gear1, place1);
		var Pair2 = new Gears(gear4, place4);
		var Pair3 = new Gears(gear5, place5);
		endcard.vert.visible = false;
		endcard.horiz.visible = false;
		win.visible = false;
		fail.visible = false;
		createjs.Ticker.addEventListener('tick', tick);
		function tick() {
			if (update) {
				update = false;
				stage.update();

		function gameEnd() {
			if (counter < 3 && timer.currentFrame >= 599) {

				console.log('FAIL');
				fail.visible = true;
				fail.play();
				failSFX.play();
				window.removeEventListener('gameEnd', gameEnd);
			}
			if (counter >= 3 && timer.currentFrame < 599) {
				musicBG.pause();
				console.log('SUCCESS');
				timer.stop();
				timerSFX.pause();
				win.visible = true;
				win.play();
				successSFX.play();
				window.removeEventListener('gameEnd', gameEnd);
			}

			tempContext.drawImage(context.canvas, 0, 0);
			canvas.width = width;
			canvas.height = height;
			context.drawImage(tempContext.canvas, 0, 0);
